import React from 'react';
import Container from '../../common/Container/Container';
import { gallery } from '../../content/gallery';
import Fade from 'react-reveal/Fade';
import './Gallery.scss';

const Gallery = () => {
  const renderImages = gallery.map((item, index) => (
    <img className="gallery__image" src={item} key={index} alt="gallery" />
  ));
  return (
    <Fade left>
      <Container customClass="gallery">{renderImages}</Container>
    </Fade>
  );
};

export default Gallery;
